// src/pages/Home.js
import React, { useState } from "react";
import './home.css'; 

const Home = () => {
  const [imagen, setImagen] = useState("https://i.imgur.com/4i9y0uR.jpg");

  return (
    <div className="home">
      <header>
        <h1>Página de inicio</h1>
      </header>
      <main>
        <img src={imagen} alt="Imagen de playa" />
        <p>
          Esta es una página de inicio para una empresa de viajes. La imagen muestra una playa hermosa.
        </p>
        <button>
          Regístrate para nuestro boletín informativo
        </button>
      </main>
    </div>
  );
};


export default Home;
